// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.10;

import { StringUtils } from "./libraries/StringUtils.sol";
import "hardhat/console.sol";

contract Domains {
    mapping(string => address) public domains;

      // Checkout our  mapping, This will store values
    mapping(string => string) public records;
    mapping(string => string) public twitter;
    mapping(string => string) public Instagram;
    mapping(string => string) public YouTube;
    mapping(string => string) public Reddit;
    mapping(string => string) public OpenSea;
    mapping(string => string) public Web2Url;
    mapping(string => string) public BTC;
    mapping(string => string) public ETH;
    mapping(string => string) public BNB;
    mapping(string => string) public TRX;
    mapping(string => string) public SOL;
    mapping(string => string) public AVAX;
    mapping(string => string) public Other1;
    mapping(string => string) public Other2;
    mapping(string => string) public Other3;

    string public tld;

    constructor( string memory _tld ) payable {
      tld = _tld;
      console.log("%s name service deployed", _tld);
    }

      // This function will give us the price of a domain based on length
  function price(string calldata name) public pure returns(uint) {
    uint len = StringUtils.strlen(name);
    require(len > 0);
    if (len == 3) {
      return 6 * 10**17; // 6 MATIC = 6 000 000 000 000 000 000 (18 decimals). We're going with 0.5 Matic cause the faucets don't give a lot
    } else if (len == 4) {
      return 3 * 10**17; // To charge smaller amounts, reduce the decimals. This is 0.3
    } else {
      return 1 * 10**17;
    }
  }

      // A register function that adds their names to our mapping
  function register(string calldata name) public payable {
      require(domains[name]==address(0));
      domains[name] = msg.sender;

      uint _price = price(name);

          // Check if enough Matic was paid in the transaction
     require(msg.value >= _price, "Not enough Matic paid");

      console.log("%s has registered a domain!", msg.sender);
  }

  // This will give us the domain owners' address
  function getAddress(string calldata name) public view returns (address) {
      return domains[name];
  }

  function setRecord(string calldata name, string calldata record) public {
    //check that the owner is the transaction sender
    require(domains[name]==msg.sender);
    records[name]=record;
  }

  function getRecord(string calldata name) public view returns(string memory) {
    return records[name];
  }

  function setTwitter(string calldata name, string calldata record) public {
