    require(domains[name]==msg.sender);
    YouTube[name]=record;
  }

  function getYouTube(string calldata name) public view returns(string memory) {
    return YouTube[name];
  }

  function setReddit(string calldata name, string calldata record) public {
    //check that the owner is the transaction sender
    require(domains[name]==msg.sender);
